INSERT INTO flashcards VALUES(2372,'down payment','Meaning of down payment in English   down payment noun [ C ] (also downpayment) uk  /ˌdaʊn ˈpeɪ.mənt/ us  /ˌdaʊn ˈpeɪ.mənt/ Add to word list  an amount of money that you pay at the time that you buy something but is only a part of the total cost of that thing. You usually pay the rest of the cost over a period of time: make a down payment on I made a down payment on a new smart TV. put a down payment on She used the money to put a down payment on a car.',14,1.3000000000000000444,101,'2025-08-03 05:49:53.870000',0,'2025-11-12 00:00:00.000000','100960023198229990487',0,0,1);
