PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
	id VARCHAR(50) NOT NULL, 
	name VARCHAR(15) NOT NULL, 
	google_access_token VARCHAR NOT NULL, 
	email VARCHAR(254) DEFAULT 'none' NOT NULL, 
	phone VARCHAR(15), 
	profilepic VARCHAR(300) DEFAULT 'none' NOT NULL, 
	level VARCHAR(2), 
	role VARCHAR(10), 
	delete_date DATE, user_stripe_id VARCHAR(50), join_date DATE, last_payment_date DATE, is_active BOOLEAN, user_name VARCHAR(20), study_streak INTEGER, streak_last_date DATE, points INTEGER, flashcards_studied INTEGER, rate_three_count INTEGER, flashcards_studied_today INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE books (
	id INTEGER NOT NULL, 
	name VARCHAR(50) NOT NULL, 
	path VARCHAR(100) NOT NULL, 
	author VARCHAR(20) NOT NULL, 
	level VARCHAR(2) NOT NULL, 
	coverpath VARCHAR(100), 
	PRIMARY KEY (id)
);
CREATE TABLE teachers (
	user_id VARCHAR(50), 
	id VARCHAR(50) NOT NULL, 
	name VARCHAR(15) NOT NULL, 
	google_access_token VARCHAR NOT NULL, 
	email VARCHAR(254) DEFAULT 'none' NOT NULL, 
	phone VARCHAR(15), 
	profilepic VARCHAR(300) DEFAULT 'none' NOT NULL, 
	level VARCHAR(2), 
	role VARCHAR(10), 
	delete_date DATE, user_stripe_id VARCHAR(50), join_date DATE, last_payment_date DATE, is_active BOOLEAN, user_name VARCHAR(20), study_streak INTEGER, streak_last_date DATE, points INTEGER, flashcards_studied INTEGER, rate_three_count INTEGER, flashcards_studied_today INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (user_id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE chapters (
	id INTEGER NOT NULL, 
	book_id INTEGER NOT NULL, 
	part INTEGER NOT NULL, 
	audiopath VARCHAR(100) NOT NULL, 
	textpath VARCHAR(100) NOT NULL, 
	text TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(book_id) REFERENCES books (id)
);
CREATE TABLE stcommunication (
	user_id VARCHAR(50) NOT NULL, 
	notes TEXT, 
	teacher_id VARCHAR(50) NOT NULL, 
	PRIMARY KEY (user_id, teacher_id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(teacher_id) REFERENCES teachers (id)
);
CREATE TABLE progress (
	user_id VARCHAR(50) NOT NULL, 
	chapter_id INTEGER NOT NULL, 
	read BOOLEAN NOT NULL, 
	notes VARCHAR, 
	PRIMARY KEY (user_id, chapter_id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(chapter_id) REFERENCES chapters (id)
);
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE IF NOT EXISTS "flashcards" (
	id INTEGER NOT NULL, 
	question VARCHAR NOT NULL, 
	answer VARCHAR NOT NULL, 
	level INTEGER NOT NULL, 
	ease INTEGER NOT NULL, 
	interval INTEGER NOT NULL, 
	last_review DATETIME, 
	show_answer BOOLEAN NOT NULL, 
	next_review DATETIME, 
	user_id VARCHAR(50) NOT NULL, 
	reviewed_by_tc BOOLEAN NOT NULL, 
	add_by_tc BOOLEAN NOT NULL, 
	add_by_user BOOLEAN NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
COMMIT;
